Products Short reviews 
.
@nuface I’m going to be consistent with this and will update . 

@jayjunus Okra Eyepatches . These are my favorite from them . Very hydrating. 
.
@saiebeauty Slip Tint Tinted moisturizer. This is fantastic for those that prefer light coverage and want that glowy and dewy look.  I’m really impressed . @glowopedia influenced me on this buy 👍
.
@milkmakeup Sunshine Under Eye Tint + Brighten . For dry skin like mine , concealers tend to be too drying . This is super hydrating while providing enough coverage . The applicator is cute , but it can get messy imo. 
.
@diorbeauty Iconic Rouge Nude Look , very moisturizing and the color is a cool tone nude . Also the viral link Dior Blush. I’m not a fan of this blush bc it’s not pigmented .
.
@rarebeauty Blush “ Grateful” I like this blush a lot as a lip stain . Very pigmented and pretty for spring . The Cream Blush “Nearly Apricot “ isn’t as pigmented as I wanted . It’s a beautiful color and good formula.  But I prefer more pigmented blushes . 

@toofaced Maximum Plump is my favorite lip plumper atm. It does a good job at plumping my lips making them looking healthy . 
.

.
@lorealusa Lash Paradise . This is their new formulation . I have been using it almost every day ! If you have short and straight Asian lashes like me , mascaras are hard to find . I find this does a good job giving volume and length . 
.
@moroccanoil Oil Treatment . I love this oil. Smells good and condition my hair . Love how my hair looks healthy after using it . 
.
